The problem is that the centered variant is not centered on the screen. I have tried adding `mx-auto` to the className, but it does not seem to work. Can someone please help me figure out what I am doing wrong?

## Answer (1)

You need to add `flex` to the parent element and `mx-auto` to the child element.

```
import React from 'react';

type Props = {
  variant: 'full-width' | 'centered';
  children: React.ReactNode;
};

const Layout: React.FC<Props> = ({ variant, children }) => {
  return (
    <div
      className={`flex ${
        variant === 'full-width' ? 'w-full' : 'mx-auto'
      } max-w-7xl px-4 sm:px-6 lg:px-8`}
    >
      <div className="mx-auto">
        {children}
      </div>
    </div>
  );
};

export default Layout;
```

