Here's a simple function that should do what you're asking for. This function uses the `shortcode_atts` function to set default values for the shortcode attributes, and then uses the `WP_Query` class to retrieve the custom posts based on the specified parameters.

```php
function custom_posts_shortcode( $atts ) {
    $atts = shortcode_atts( array(
        'posts' => -1,
        'category' => '',
        'taxonomy' => '',
        'term' => '',
    ), $atts );

    $args = array(
        'post_type' => 'your_custom_post_type',
        'posts_per_page' => $atts['posts'],
    );

    if ( ! empty( $atts['category'] ) ) {
        $args['category_name'] = $atts['category'];
    }

    if ( ! empty( $atts['taxonomy'] ) && ! empty( $atts['term'] ) ) {
        $args['tax_query'] = array(
            array(
                'taxonomy' => $atts['taxonomy'],
                'field'    => 'slug',
                'terms'    => $atts['term'],
            ),
        );
    }

    $query = new WP_Query( $args );

    if ( $query->have_posts() ) {
        $output = '<ul>';
        while ( $query->have_posts() ) {
            $query->the_post();
            $output .= '<li><a href="' . get_permalink() . '">' . get_the_title() . '</a></li>';
        }
        $output .= '</ul>';
        wp_reset_postdata();
    } else {
        $output = '<p>No posts found.</p>';
    }

    return $output;
}
add_shortcode( 'custom_posts', 'custom_posts_shortcode' );
