I'm glad to hear you're interested in compiler optimization! Here are a few popular techniques along with simple examples to illustrate how they work:

1. **Constant Folding**: This technique replaces constant expressions with their values at compile time.

   *Example*:
   ```c
   int add(int a, int b) {
       return a + b;
   }

   int main() {
       int x = add(2, 3); // Before optimization
       int y = add(2, 3); // After optimization (constant folding)
   }
   ```

   After constant folding, the `add` function call in `main` can be replaced with the constant value `5`.

2. **Dead Code Elimination (DCE)**: DCE removes code that will never be executed or whose results are never used.

   *Example*:
   ```c
   int main() {
       int x = 5;
       int y = x + 1; // y is never used
       return x; // Return statement is dead code if the function doesn't return
   }
   ```

   In this example, the variable `y` and the return statement can be eliminated as they are dead code.

3. **Common Subexpression Elimination (CSE)**: CSE replaces multiple occurrences of the same expression with a single occurrence.

   *Example*:
   ```c
   int main() {
       int a = 5, b = 10;
       int x = a + b; // x = 15
       int y = a + b; // y = 15 (same as x)
       return x + y; // (15 + 15) = 30
   }
   ```

   After CSE, the second occurrence of `a + b` can be replaced with `x`, reducing the expression to `x + x` or `2 * x`.

4. **Loop Optimization - Loop Unrolling**: Loop unrolling reduces the overhead of loop control code by replicating the loop body multiple times.

   *Example*:
   ```c
   void loop(int n) {
       int i, sum = 0;
       for (i = 0; i < n; i++) {
           sum += i;
       }
   }

